import React from "react";
import Layout from "../../components/Layout/Layout";

const Users = () => {
  return (
    <Layout>
      <div className="row">
        <div className="col mb-3"></div>
        <div className="col mb-9"></div>
        <h1>All Users</h1>
      </div>
    </Layout>
  );
};

export default Users;
